@NgModule({
  declarations: [
    AppComponent,
    HomeComponent,
    DashboardComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    DragDropModule,
    NgbModule,

    // AuthModule
    AuthModule.forRoot({
      domain: 'dev-ob4gwafsujzfuged.eu.auth0.com',  
      clientId: 'LdztHT6pYrwZk8c7DInolkVnuTtym72N',
      authorizationParams: {
        redirect_uri: 'http://localhost:4200/',
      },
    }),
  ],
  providers: [],
  bootstrap: [AppComponent]
})
